import styles from "./Header.module.scss";
import Casa from "../../assets/images/Casa.svg";

import UserAvatarIcon from "../../assets/images/UserAvatarIcon.svg";
import Wallet from "../../assets/images/Wallet.png";
import { useAuth } from "../../contexts/authContext";
import { Link } from "react-router-dom";

interface Props {
   fromPage?: string;
}

function Header({ fromPage }: Props) {
   const authContext = useAuth();
   const { isLogged } = authContext;

   return (
      <header
         className={`${styles.header} ${
            fromPage === "index" ? `${styles.headerIndex}` : ""
         }   `}
      >
         <nav>
            <ul>
               <li>
                  <a href="/">
                     <img src={Casa}></img>
                  </a>
               </li>
               <span>
                  {isLogged && (
                     <Link to="/profile" className={styles.userAvatarIcon}>
                        <img
                           src={UserAvatarIcon}
                           alt="Profile Icon"
                           width={36}
                        ></img>
                     </Link>
                  )}
                  {isLogged && (
                     <Link to="/wallet" className={styles.userWalletIcon}>
                        <img src={Wallet} alt="Wallet Icon" width={36}></img>
                     </Link>
                  )}
               </span>
            </ul>
         </nav>
      </header>
   );
}

export default Header;
